reviously identified in humans.\\nCoronaviruses are zoonotic, meaning they are transmitted between animals and people.  Detailed investigations found that SARS-CoV was transmitted from civet cats to humans and MERS-CoV from camels to humans. Several known coronaviruses are circulating in animals that have not yet infected humans. It is believed that COVID-19 was transmitted from pangolin to humans (current theory).\\nCommon signs of infection include respiratory symptoms, fever, cough, shortness of breath and breathing difficulties. In more severe cases, infection can cause pneumonia, severe acute respiratory syndrome, kidney failure and even death (WHO). \\nNinja Nerd Lectures has compiled the most up to date and recent data on COVID-19 as of March 15, 2020. Please follow along with this lecture to understand the treatment, prognosis, and precautions for COVID-19 (current as of 3\/15\/2020). \\nAs new information and research is published we will continue to provide updates on COVID-19 and ensure all of our viewers are kept up to date on the most recent data. \\n\\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC). \\n\\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC).  \\n\\n\\nSupport us by purchasing apparel and donating to our PayPal or Patreon! 😄\\n\\n--Become a Patron of ours and receive the final, high resolution photo of the lecture!\\n\\nFUNDING\\n\\nGoFundMe | https:\/\/www.gofundme.com\/ninja-nerd-science\\n\\nAPPAREL |\\nAmazon Prime Free Delivery | https:\/\/www.amazon.com\/Ninja-Nerd-Science\/dp\/B07N27WLDR\/ref=sr_1_1?dchild=1\\u0026keywords=ninja+nerd+science\\u0026qid=1577670861\\u0026sr=8-1\\nTeespring | https:\/\/teespring.com\/stores\/ninja-nerd \\n\\nPATREON | https:\/\/www.patreon.com\/NinjaNerdScience\\n\\n\\nSOCIAL MEDIA\\n\\nFACEBOOK | https:\/\/www.facebook.com\/NinjaNerdScience\\n\\nINSTAGRAM | https:\/\/www.instagram.com\/ninjanerdscience\\n\\n\\nAL  is published we will continue to provide updates on COVID-19 and ensure all of our viewers are kept up to date on the most recent data. \n\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC). \n\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC).  \n\n\nSupport us by purchasing apparel and donating to our PayPal or Patreon! 😄\n\n--Become a Patron of ours and receive the final, high resolution photo of the lecture!\n\nFUNDING\n\nGoFundMe | "},{"text":"https://www.gofundme.com/ninja-nerd-s...","navigationEndpoint":{"clickTrackingParams":"CJYBEM2rARgCIhMI563Ww66k6QIVCIp8Ch0VUQQdSJKwndjXv4PtrQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.gofundme.com%2Fninja-nerd-science\u0026redir_token=8GqxO89wZquyNSaR3ap5c3BnYCN8MTU4OTAzMDYzMUAxNTg4OTQ0MjMx\u0026v=rdoN_XsHWBI\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.gofundme.com%2Fninja-nerd-science\u0026redir_token=8GqxO89wZquyNSaR3ap5c3BnYCN8MTU4OTAzMDYzMUAxNTg4OTQ0MjMx\u0026v=rdoN_XsHWBI\u0026event=video_description","target":"TARGET_NEW_WINDOW","nofollow":true}}},{"text":"\n\nAPPAREL |\nAmazon Prime Free Delivery | "},{"text":"https://www.amazon.com/Ninja-Nerd-Sci...","navigationEndpoint":{"clickTrackingParams":"CJYBEM2rARgCIhMI563Ww66k6QIVCIp8Ch0VUQQdSJKwndjXv4PtrQE=","commandMetadata":{"webCommandMetadata":{"url":"/redirect?q=https%3A%2F%2Fwww.amazon.com%2FNinja-Nerd-Science%2Fdp%2FB07N27WLDR%2Fref%3Dsr_1_1%3Fdchild%3D1%26keywords%3Dninja%2Bnerd%2Bscience%26qid%3D1577670861%26sr%3D8-1\u0026redir_token=8GqxO89wZquyNSaR3ap5c3BnYCN8MTU4OTAzMDYzMUAxNTg4OTQ0MjMx\u0026v=rdoN_XsHWBI\u0026event=video_description","rootVe":83769}},"urlEndpoint":{"url":"/redirect?q=https%3A%2F%2Fwww.amazon.com%2FNinja-Nerd-Science%2Fdp%2FB07N27WLDR%2Fref%3Dsr_1_1%3Fdchild%3D1%26keywords%3Dninja%2Bnerd%2Bscience%26qid%3D1577670861%26sr%3D8-1\u0026redir_token=8GqxO89wZquyNSaR3a ? Coronaviruses (CoV) are a large family of viruses that cause illness ranging from the common cold to more severe diseases such as Middle East Respiratory Syndrome (MERS-CoV) and Severe Acute Respiratory Syndrome (SARS-CoV). Coronavirus disease (COVID-19) caused by SARS-COV2 is a new strain that was discovered in 2019 and has not been previously identified in humans.\nCoronaviruses are zoonotic, meaning they are transmitted between animals and people.  Detailed investigations found that SARS-CoV was transmitted from civet cats to humans and MERS-CoV from camels to humans. Several known coronaviruses are circulating in animals that have not yet infected humans. It is believed that COVID-19 was transmitted from pangolin to humans (current theory).\nCommon signs of infection include respiratory symptoms, fever, cough, shortness of breath and breathing difficulties. In more severe cases, infection can cause pneumonia, severe acute respiratory syndrome, kidney failure and even death (WHO). \nNinja Nerd Lectures has compiled the most up to date and recent data on COVID-19 as of March 15, 2020. Please follow along with this lecture to understand the treatment, prognosis, and precautions for COVID-19 (current as of 3/15/2020). \nAs new information and research is published we will continue to provide updates on COVID-19 and ensure all of our viewers are kept up to date on the most recent data. \n\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC). \n\nREFERENCES: World Health Organization (WHO), Centers for Disease Control and Prevention (CDC).  \n\n\nSupport us by purchasing apparel and donating to our PayPal or Patreon! 😄\n\n--Become a Patron of ours and receive the final, high resolution photo of the lecture!\n\nFUNDING\n\nGoFundMe | https://www.gofundme.com/ninja-nerd-science\n\nAPPAREL |\nAmazon Prime Free Delivery | https://www.amazon.com/Ninja-Nerd-Science/dp/B07N27WLDR/ref=sr_1_1?dchild=1\u0026keywords=ninja+nerd+science\
